package com.amandris.clients.web.view;import org.apache.struts.action.ActionForm;public class ServiceView extends ActionForm{	private String 	id;	private String 	sellerId;	private String 	serviceTypeText;	private String 	serviceTypeConst;	private String  sexConst;	private String  serviceFirstHourPrice;	private String  serviceAdditionalHoursPrice;	private Double  serviceFirstHourPriceDouble;	private Double  serviceAdditionalHoursPriceDouble;	private String 	currencyConst;	private String 	currencyText;	private String  oddOrEven;		private static final long serialVersionUID = 1526471155622776010L;		public ServiceView()	{		id							= "";		sellerId					= "";		serviceTypeConst			= "";		serviceTypeText				= "";		sexConst					= "";		serviceFirstHourPrice		= "";		serviceAdditionalHoursPrice	= "";		currencyConst				= "";		currencyText				= "";				oddOrEven					= "";	}	public String getCurrencyConst() {		return currencyConst;	}	public void setCurrencyConst(String currencyConst) {		this.currencyConst = currencyConst;	}	public String getId() {		return id;	}	public void setId(String id) {		this.id = id;	}	public String getOddOrEven() {		return oddOrEven;	}	public void setOddOrEven(String oddOrEven) {		this.oddOrEven = oddOrEven;	}	public String getSellerId() {		return sellerId;	}	public void setSellerId(String sellerId) {		this.sellerId = sellerId;	}	public String getServiceAdditionalHoursPrice() {		return serviceAdditionalHoursPrice;	}	public void setServiceAdditionalHoursPrice(String serviceAdditionalHoursPrice) {		this.serviceAdditionalHoursPrice = serviceAdditionalHoursPrice;	}	public Double getServiceAdditionalHoursPriceDouble() {		return serviceAdditionalHoursPriceDouble;	}	public void setServiceAdditionalHoursPriceDouble(			Double serviceAdditionalHoursPriceDouble) {		this.serviceAdditionalHoursPriceDouble = serviceAdditionalHoursPriceDouble;	}	public String getServiceFirstHourPrice() {		return serviceFirstHourPrice;	}	public void setServiceFirstHourPrice(String serviceFirstHourPrice) {		this.serviceFirstHourPrice = serviceFirstHourPrice;	}	public Double getServiceFirstHourPriceDouble() {		return serviceFirstHourPriceDouble;	}	public void setServiceFirstHourPriceDouble(Double serviceFirstHourPriceDouble) {		this.serviceFirstHourPriceDouble = serviceFirstHourPriceDouble;	}	public String getServiceTypeConst() {		return serviceTypeConst;	}	public void setServiceTypeConst(String serviceTypeConst) {		this.serviceTypeConst = serviceTypeConst;	}	public String getSexConst() {		return sexConst;	}	public void setSexConst(String sexConst) {		this.sexConst = sexConst;	}	public String getServiceTypeText() {		return serviceTypeText;	}	public void setServiceTypeText(String serviceTypeText) {		this.serviceTypeText = serviceTypeText;	}	public String getCurrencyText() {		return currencyText;	}	public void setCurrencyText(String currencyText) {		this.currencyText = currencyText;	}}